This is the phase where the package should be assembled/compiled/linked and so on. All steps executed during the build will have the working directory seto to $PKGER_BLD_DIR . This directory will contain either extracted sources if source is specified in metadata or a git repository if git was specified. [build]
steps = [ "$HOME/.cargo/bin/cargo build --release .", { images = ["debian10"], cmd = "echo 'hello from Debian'" }, # will only be executed on image `debian10` { rpm = true, cmd = "echo 'will only run on images with target == `rpm`'" } # same applies to other targets # { pkg = false, deb = true, gzip = false, cmd = "echo test" }
]

15.body:
Optional steps that (if provided) will be executed after the build phase. Working directory of each step will be set to $PKGER_OUT_DIR so you can use relative paths with commands like install. Each file that ends up in $PKGER_OUT_DIR will be available in the final package unless explicitly excluded by exclude field in metadata . So in the example below, the file that is installed will be available as /usr/bin/pkger with permissions preserved. [install]
steps = [ "install -m755 $PKGER_BLD_DIR/target/release/pkger usr/bin/pkger"
]

