This fields are responsible for fetching the files used for the build. When both git and source are specified pkger will fetch both to the build directory. If source starts with a prefix like http or https the file that if points to will be downloaded. If the file is an archive like .tar.gz or .tar.xz or .zip it will be directly extracted to $PKGER_BLD_DIR , otherwise the file will be copied to the directory untouched. source = "" # remote source or file system location git = "https://github.com/wojciechkepka/pkger.git" # will default to branch = "master"
